import React from 'react';
import './css/friends.css';

const Friends = ({svg1, svg2, svg3 }) => {
    return (
        <div>
            <section>
                <div>
                    <p>Amigos</p>
                    { svg1 } 
                </div>

                <div>
                    <p>Nitro</p>
                    { svg2 } 
                </div>
               <p>Mensagem Direta {svg3} </p>
               <div>
                   <div></div>
                   <p>Nome</p>
               </div>
            </section>
        </div>
    )
}

Friends.defaultProps = {
    svg1:<svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" fill="currentColor" class="bi bi-person" viewBox="0 0 16 16">
    <path d="M8 8a3 3 0 1 0 0-6 3 3 0 0 0 0 6zm2-3a2 2 0 1 1-4 0 2 2 0 0 1 4 0zm4 8c0 1-1 1-1 1H3s-1 0-1-1 1-4 6-4 6 3 6 4zm-1-.004c-.001-.246-.154-.986-.832-1.664C11.516 10.68 10.289 10 8 10c-2.29 0-3.516.68-4.168 1.332-.678.678-.83 1.418-.832 1.664h10z"/>
    </svg>,
    svg2: <img src="./imgs/nitro-icon.png" alt=""/>,
    svg3: '+',
}
export default Friends;
